import React from 'react';
import {Switch, Route} from "react-router-dom"
import './global.scss';
import Header from "./components/Header/Header"
import SideBar from './components/SideBar/SideBar';
function App() {
  return (
    <div className="appWrapper">
      <Header/>
      <SideBar/>
      <Switch>
                {/* <Route path="/auth/signin" component={SignIn} /> */}
                {/* <Route exact path="/" component={() => <Redirect to="/auth/signin" />} /> */}
                <ProtectedRoute path="/research" component={() => <Research getCars={getCars}/>} />
                <ProtectedRoute path="/hotlist" component={() => <HotList getCars={getCars} cars={cars}/>} />
                <ProtectedRoute path="/pricelist" component={() => <PriceList/>} />
                <ProtectedRoute path="/pulltickets" component={() => <SelectTickets {...{pullTickets}}/>} />
                <ProtectedRoute path="/viewticket" component={() => <ViewTicket {...{currentPullTicket}}/>} />
            </Switch>
    </div>
  );
}

export default App;
